package io.github.abitgen.leetcode.challenge30.twenty20April._21_leftmostColumnWithOne

import org.hamcrest.CoreMatchers.`is`
import org.hamcrest.MatcherAssert.assertThat
import org.junit.After
import org.junit.Before
import org.junit.Test

class TestLeftMostColumnWithOne {

    lateinit var bm: BinaryMatrix

    @Before
    fun `init`() {
        bm = BinaryMatrixImpl()
    }

    @Test
    fun `2*2 matrix with all 0's should return -1`() {
        bm.set(
            arrayOf(
                intArrayOf(0, 0),
                intArrayOf(0, 0)
            )
        )

        assertThat(LeftmostColumnWithOne.leftMostColumnWithOne(bm), `is`(-1))
    }

    @Test
    fun `3*3 matrix should return 1`() {
        bm.set(
            arrayOf(
                intArrayOf(0, 0, 0),
                intArrayOf(0, 1, 0),
                intArrayOf(0, 0, 1)
            )
        )

        assertThat(LeftmostColumnWithOne.leftMostColumnWithOne(bm), `is`(1))
    }

    @Test
    fun `7*7 matrix should return 1`() {

        bm.set(
            arrayOf(
                intArrayOf(0, 0, 1, 1, 1, 1, 1),
                intArrayOf(0, 1, 1, 1, 1, 1, 1),
                intArrayOf(0, 0, 0, 1, 1, 1, 1),
                intArrayOf(0, 0, 0, 1, 1, 1, 1),
                intArrayOf(0, 0, 0, 0, 0, 0, 0),
                intArrayOf(0, 0, 0, 0, 0, 1, 1),
                intArrayOf(0, 0, 0, 1, 1, 1, 1)
            )
        )

        assertThat(LeftmostColumnWithOne.leftMostColumnWithOne(bm), `is`(1))

    }


